from functools import lru_cache
from itertools import count, islice
from sympy import divisor_count, divisors
@lru_cache(maxsize=10**8)
def tau(k): return divisor_count(k)
def f(k, minv=0):
    tauk = tau(k)
    if tauk < minv: return -1
    return sum(1 for d in divisors(k) if tauk == tau(k//d+d))
def agen():
    n, adict = 0, {0:1, 2:2}
    for k in count(3, 2):
        v = f(k, minv=2*n)
        if v not in adict:
            adict[v] = k
            while 2*n in adict: yield adict[2*n]; n += 1
print(list(islice(agen(), 9))) # _Michael S. Branicky_, Dec 14 2025

